import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

class AddEventButton extends Component {
    render(){
        <div>
            <addEventButtonLink to="/addEvent" label="+" />
        </div>
    }
}


function addEventButtonLink({ label_text, label_button, to, activeOnlyWhenExact }) {
    return (
      <Route
        path={to}
        exact={activeOnlyWhenExact}
        children={({ match }) => (
          <div className={match ? "addEvent active" : "addEvent"} >
            <Link to={to}>
                <p className="addEvent_text">{label_text}</p>
                <p className="addEvent_button">{label_button}</p>
        </Link>
          </div>
        )}
      />
    );
}

export default AddEventButton
